import { Component, OnInit } from '@angular/core';
import axios from 'axios';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit{
  Data = [];
  constructor(){}

  ngOnInit(): void {
    axios.get("/api/Product/")
    .then(res=>{
      this.Data = res.data;
    }).catch(err=>{
      console.log(err);
    })
  }

}
